import React from 'react';
import './App.css';
import { Map } from './src/components/Map.js';

function App() {
  return (
    <Map
          google={this.props.google}
          zoom={8}
          style={mapStyles}
          initialCenter={{ lat: 47.444, lng: -122.176}}
        />
  );
}

const mapStyles = {
  width: '100%',
  height: '100%',
};

export default App;
